import React from "react"; 
import "./Aethesticism.css";
const Aethesticism = () => {
    return (
    <React.Fragment>
    <h1>Aethesticism Page</h1>
    <div className='main-container'>
    <span className='text'>Aesthetism</span>
    <div className='section' />
    <div className='box'>
      <span className='text-2'>Almost there !</span>
    </div>
    <div className='section-2' />
    <div className='img' />
    </div>
    </React.Fragment>
    )
};
export default Aethesticism
